import styled from 'styled-components';

const StyleCustom = (props) => {
  const StyledCounter = styled.div`
    :root {
      --backgraung-color: #a1a1a1;
      --user-color: ${props.themeStyle.color};
    }
    * {
      --user-color: ${props.color};
    }
    .darkTheme {
      --user-color: ${(props) => props.color};
      --backgraung-color: #a1a1a1;
    }
    .lightTheme {
      --user-color: ${(props) => props.color};
      --backgraung-color: ${(props) => props.backgraungColor};
    }
  `;
  console.log(props.themeStyle);
  return (
    <StyledCounter>
      {props.children}
    </StyledCounter>
  );
};

export default StyleCustom;
